import React from 'react';
import styled from 'styled-components';

export default function Survey() {
    return (
        <Container>
            <Logo></Logo>
            <Question></Question>
            <></>
        </Container>
    );
}

const Container = styled.div`
    background: #5C5649;
    width: 100%;
    height: 100vh;
`
